《'''GANG☆STAR'''》是[[Mediamix|跨媒体作品]]《[[少女歌剧 Revue Starlight|少女☆歌剧 Revue Starlight]]》一单限定小组曲《PRINCIPAL -Fancy You-》的收录曲目，由[[天堂真矢]]<sup>(CV.[[富田麻帆]])</sup>、[[西条克洛迪娜]]<sup>(CV.[[相羽爱奈]])</sup>、[[石动双叶]]<sup>(CV.[[生田辉]])</sup>、[[花柳香子]]<sup>(CV.[[伊藤彩沙]])</sup>演唱。

